import BookContextProvider from './contexts/BookContext';
import Navbar from './components/Navbar.js';
import BookList from './components/BookList';
import BookForm from './components/BookForm';

function App() {
  return (
    <div className="App">
      <BookContextProvider>
        <Navbar />
        <BookList />
        </BookContextProvider>
        <BookForm />

    </div>
  );
}

export default App;
